import React from "react";
import DropDown from "../helpers/DropDown";

function Navbar() {
  return (
    <div className="w-full h-20 bg-blue-400 flex flex-row justify-center items-center space-x-20">
      <div className=""></div>
      <div className="flex flex-row space-x-10">
        <button className="bg-gray-200 hover:bg-gray-400 text-gray-700 font-bold py-3 md:px-7 px-4 rounded text-lg">
          Start
        </button>
        <button className="bg-gray-200 hover:bg-gray-400 text-gray-700 font-bold py-3 md:px-7 px-4 rounded text-lg">
          End
        </button>
      </div>
      <div className="">
        <DropDown />
      </div>
    </div>
  );
}

export default Navbar;
